Faqat oziq-ovqat mahsulotlarini sotish va xizmatlar ko'rsatish uchun jihozlangan binoda joylashgan chakana savdo muasassasidir.
Non mahsulotlari (non, baton, bulka);
Un va makaron mahsulotlari;
Sabzavotlar va mevalar;
Konservalar (go'sht, sabzavot, qo'ziqorin, baliq, meva);
Sut mahsulotlari (sut, fermentlangan pishirilgan sut, yogurt, kefir, tvorog, sariyog ', smetana, muzqaymoq, quyultirilgan sut);
Oziq-ovqat mahsulotlari (shakar, don, kungaboqar yog'i);
Go'sht va kolbasa mahsulotlari;
baliq;
Pishloqlar;
Qandolat mahsulotlari (shokolad, shirinliklar, pechene, tortlar);
Yarim tayyor mahsulotlar (chuchvara, chuchvara, sabzavot va meva aralashmalari, tovuq, go'sht va baliq mahsulotlari);
Ichimliklar (sharbatlar, gazlangan, shisha suv);
Qahva, choy, kakao;
shakar, tuz, ziravorlar;
Tuxum;
Bolalar ovqatlari va gigiena vositalari.

