Автошкола &mdash; образовательное учреждение, в котором происходит обучение вождению транспортных средств.
Делятся на категории:
B &mdash; автомобили, трициклы и квадроциклы, масса которых не превышает 3,5 тонны; можно выбрать обучение на механике или на автомате.
А &mdash; мотоциклы, мопеды;
С &mdash; грузовые автомобили массой свыше 3,5 тонн;
D &mdash; 9-16-местные автомобили и автобусы с прицепом, а также автобусы с двумя салонами;
Е &mdash; эта буква используется для дополнения и уточнения транспортного средства.
